import React from 'react';
import { Text, View } from "react-native"
import { sum2Number, substract2Number, PI } from '../util/Calculator';
const Welcome = (props: any) => {
    const { x, y, person, products } = props;
    const { name, age, email } = person;
    console.log(products);
    return (
        <View style={{
            padding: 20
        }}>
            <Text>X: {x} and Y: {y}</Text>
            <Text>Person: name - {name}, age - {age}, email - {email}</Text>
            <Text>{JSON.stringify(products)}</Text>
            {products.map((eachProduct: any) => {
                return (
                    <Text key={eachProduct.year}>{eachProduct.productName}, {eachProduct.year}</Text>
                )
            })}
            <Text> sum 2 and 3: {sum2Number(2, 3)}</Text>
            <Text> sub 10 and 8: {substract2Number(10, 8)}</Text>
            <Text> PI = {PI}</Text>
        </View>
    )
}

export default Welcome
